import React, { useState } from 'react';
import { BrowserRouter, Route, Routes, useNavigate } from 'react-router-dom';
import HappyKids from './pages/HappyKids'; // Import HappyKids component

function App() {
  const [events] = useState([
    { id: 1, title: 'Foster for Kitten or Cat', date: '12-02-2025' },
    { id: 2, title: 'Happy Kids', date: '01-03-2025' },
    { id: 3, title: 'Save the world', date: '22-04-2025' },
  ]);

  return (
    <BrowserRouter>
      <div className="App">
        {/* Header Section */}
        <header className="header">
          <div className="home">
            <p>SHARE-CARE</p>
          </div>
        </header>

        {/* Main Content */}
        <main className="main-content">
          <section className="events">
            <h2>Upcoming Events</h2>
            <ul>
              {events.map((event) => (
                <EventItem key={event.id} event={event} />
              ))}
            </ul>
          </section>

          {/* Define Routes */}
          <Routes>
            <Route path="/event/2" element={<HappyKids />} />
            {/* Other event routes can be added here as needed */}
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}

// EventItem Component to handle click and navigate
const EventItem = ({ event }) => {
  const navigate = useNavigate();

  const handleClick = () => {
    // Navigate programmatically to the event detail page
    navigate(`/event/${event.id}`);
  };

  return (
    <li>
      <h3 onClick={handleClick} style={{ cursor: 'pointer', color: 'blue' }}>
        {event.title}
      </h3>
      <p>Date: {event.date}</p>
    </li>
  );
};

export default App;
